            <Title>ScroeBoard</Title>
            <StyledLink to="/">Back</StyledLink>
        </div>
    );
  }
export default () => {
    return (
      <Router>
        <Switch>
          <Route exact path="/game" component={Game} />
          <Route exact path="/scroeBoard" component={ScroeBoard} />
        </Switch>
      </Router>
    );
  };

const Title = styled.h1`
  font-size: calc(5px + 2vmin);
`
